import React, { useState } from 'react';

function PlacementHistory() {
    // Example placement data
    const [placements] = useState([
        { id: 1, name: 'John Doe', company: 'Google', role: 'Software Engineer', year: 2023 },
        { id: 2, name: 'Jane Smith', company: 'Microsoft', role: 'Cloud Engineer', year: 2023 },
        { id: 3, name: 'Bob Johnson', company: 'Amazon', role: 'Data Scientist', year: 2022 },
        { id: 4, name: 'Alice Brown', company: 'Facebook', role: 'Frontend Developer', year: 2022 },
        { id: 5, name: 'Charlie Green', company: 'Tesla', role: 'Mechanical Engineer', year: 2021 },
    ]);

    return (
        <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
            <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>Placement History</h1>
            <p style={{ textAlign: 'center', fontSize: '16px', marginBottom: '30px' }}>
                Below is the list of students who have been successfully placed in various companies.
            </p>

            <table
                style={{
                    width: '100%',
                    borderCollapse: 'collapse',
                    boxShadow: '0 2px 6px rgba(0, 0, 0, 0.2)',
                }}
            >
                <thead>
                    <tr style={{ backgroundColor: '#007BFF', color: '#fff' }}>
                        <th style={{ padding: '10px', border: '1px solid #ddd' }}>ID</th>
                        <th style={{ padding: '10px', border: '1px solid #ddd' }}>Name</th>
                        <th style={{ padding: '10px', border: '1px solid #ddd' }}>Company</th>
                        <th style={{ padding: '10px', border: '1px solid #ddd' }}>Role</th>
                        <th style={{ padding: '10px', border: '1px solid #ddd' }}>Year</th>
                    </tr>
                </thead>
                <tbody>
                    {placements.map((placement) => (
                        <tr
                            key={placement.id}
                            style={{
                                backgroundColor: placement.id % 2 === 0 ? '#f9f9f9' : '#fff',
                                textAlign: 'center',
                            }}
                        >
                            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{placement.id}</td>
                            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{placement.name}</td>
                            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{placement.company}</td>
                            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{placement.role}</td>
                            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{placement.year}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default PlacementHistory;
